tables.table_schema:
CREATE TABLE financial_reports (
    report_id INT PRIMARY KEY,
    report_name VARCHAR(50),
    report_date DATE
);

CREATE TABLE financial_reports (
	sales_amount DECIMAL,
	expenses_amount DECIMAL,
	profit DECIMAL
);

CREATE TABLE tax_reports (
	tax_paid DECIMAL,
	tax_deductible DECIMAL,
	tax_return DECIMAL
);

CREATE TABLE financial_planning (
	budget_amount DECIMAL,
	forecasted_revenue DECIMAL,
	predicted_expenses DECIMAL
);
